webpackJsonp([30928113273667],{7795:function(e,t){e.exports={data:{post:{html:"<p>From a <a href=\"http://www.dw-world.de/dw/article/0,,2338613,00.html\">Deutsche Welle analysis of the Kurnaz case</a>:</p>\n<blockquote><p>\n  Legally, Berlin was under no obligation to protect a German-born Turkish citizen imprisoned in Guantanamo. But moral and political responsibility for a permanent resident unjustly detained is another matter, experts say.\n</p></blockquote>\n<p>Um, right, like the German government is going to lift a finger for <em>me</em> if I ever get in trouble. Let's just say that if I've got one phone call before I get shipped to the Gulag, I'm calling the embassy with the blue passports, not the one with the red passports.</p>",fields:{title:"Wrong Passport",date:"07 Feb 2007",url:"https://papascott.de/2007-02-07-wrong-passport/"}}},pathContext:{slug:"/2007-02-07-wrong-passport/",prev:{fields:{title:"Conscientious Objector",date:"07 Feb 2007",slug:"/2007-02-07-conscientious-objector/"}},next:{fields:{title:"Hello World, We're Here Again",date:"09 Feb 2007",slug:"/2007-02-09-hello-world-were-here-again/"}}}}}});
